import {APP_TYPE} from "./type";


const INITIAL_STATE = {

    isAdyenOfflineEnabledTakeawaySpecific: null
};

// eslint-disable-next-line import/no-anonymous-default-export
export default (state = INITIAL_STATE, action) => {
    switch (action.type) {
        case APP_TYPE.GET_LOGGED_USER:
            return {
                ...state,
                visibleSideMenuItems: action.payload.visibleSideMenuItems,
                hiddenSideMenuItems: action.payload.hiddenSideMenuItems
            };


        default:
            return state;
    }
};
